interface IconRendererProps {
  name: string;
  width?: number;
  height?: number;
  style?: "light" | "dark" | "mono-light" | "mono-dark";
}

export function CategoryIcon({
  name,
  width,
  height,
  style,
}: IconRendererProps) {
  const renderer = iconMap[name];

  if (!renderer) {
    return;
  }
  let iconProps: IconProps = {};
  if (style === "light") {
    iconProps = { stroke: "#000" };
  } else if (style === "dark") {
    iconProps = { stroke: "#fff" };
  } else if (style === "mono-light") {
    iconProps = { fill: "#fff", stroke: "#000" };
  } else if (style === "mono-dark") {
    iconProps = { fill: "#333", stroke: "#fff" };
  }

  return (
    <svg width={width || "64"} height={height || "64"} viewBox="0 0 200 200">
      {renderer(iconProps)}
    </svg>
  );
}
